import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, Animated, Easing } from 'react-native';
import { useNavigate } from 'react-router-dom';
import arrow from "./AlwaysActive/images/arrow.png"


const home = () => {
    const [hoveredIndex, setHoveredIndex] = useState(null);
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route); // Navigate to the corresponding route
    };

    return(
    <View style={stylesContainers.container}>
        <View style={stylesContainers.welcomeView}>
        <Text style={stylesTexts.welcomeText}>Willkommen!</Text>
        </View>
        <View style={stylesContainers.diffcont}>
        <View style={stylesContainers.viewListExponate}>
            <View>
                <View style={{flexDirection: "row",margin:20}}>
                    <Text style={stylesTexts.titleOfLists}>Exponate</Text>
                    <View style={{paddingLeft:850}}>
                        <TouchableOpacity
                        onPress={handleNavigation("/exponate")}
                        >
                        <Image
                        style={stylesTexts.images}
                        source={arrow}
                    />
                        </TouchableOpacity>                   
                    </View>
                </View>
            </View>
        </View>
        <View style={stylesContainers.viewListPersonen}>
            <View>
            <View style={{flexDirection: "row",margin:20}}>
                    <Text style={stylesTexts.titleOfLists}>Personen</Text>
                    <View style={{paddingLeft:150}}>
                    <TouchableOpacity>
                        <Image
                        style={stylesTexts.images}
                        source={arrow}
                    />
                        </TouchableOpacity>  
                    </View>
                </View>
            </View>
        </View>
        </View>
        <View style={stylesContainers.viewListAuktionen}>
            <View>
            <View style={{flexDirection: "row",margin:20}}>
                    <Text style={stylesTexts.titleOfLists}>Auktionen</Text>
                    <View style={{paddingLeft:1175}}>
                    <TouchableOpacity>
                        <Image
                        style={stylesTexts.images}
                        source={arrow}
                    />
                        </TouchableOpacity>  
                    </View>
                </View>
            </View>
        </View>
    </View>
    );

};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width:1350,
        paddingLeft:20
    },
    diffcont:{
        flexDirection: "row",
        padding: 20

    },
    viewListExponate: {
        borderWidth: 1,               
        borderColor: 'lightgray',         
        borderRadius: 5,             
        paddingLeft: 10,
        paddingRight: 10, 
        height: 300,
        width:1000,  
        margin: 10             
    },
    viewListPersonen:{
        borderWidth: 1,               
        borderColor: 'lightgray',         
        borderRadius: 5,             
        paddingLeft: 10,
        paddingRight: 10,    
        height: 300,
        width:300, 
        margin: 10             


    },
    viewListAuktionen:{
        borderWidth: 1,               
        borderColor: 'lightgray',         
        borderRadius: 5,             
        height: 300,
        width:1325,  

    },
    welcomeView:{
        paddingTop:40,
        paddingBottom: 20,
    }
});

const stylesTexts = StyleSheet.create({
    welcomeText:{
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize:50,
    },
    normalText:{

    },
    titleOfLists:{
        color: 'rgba(141,69,85,1)',
        fontWeight: "bold",
        fontSize:17
    },
    contentNamesOfLists:{

    },
    contentOfLists:{

    },
    images: {

        width: 20,
        height: 20,
    },


});
export default home;
